import React from 'react';
import './App.css';
import Navigation from './components/Navigation';
import NotesList from './components/NotesList';
import CreateUser from './components/CreateUser';
import CreateNote from './components/CreateNote';

function App() {
  return (
  <div>
    <Navigation/>
    <NotesList/>
    <CreateNote/>
    <CreateUser/>
    Hello World
  </div>
  );
}

export default App;
